Column.Formula:
LET $mostRecentCategory := 
ARRAY_LAST(
	ARRAY_WHERE(
		EACH [Element Category], $(i, item) 
		AND(
		  $i < [LineNumber], 
	      $item <> NULL()
		)
	)
);

RETURN
IF( 
	AND(
		[New Category] == TRUE, 
		ISNULL([Element Category])
	),
	"",


	AND(
		[New Category] <> TRUE//, 
		//[Element] <> NULL()
	),
	$mostRecentCategory,

	AND(
		[New Category] == TRUE, 
		NOT(ISNULL([Element Category]))
	),
	[Element Category]
)

ARRAY_LENGTH(
	ARRAY_WHERE(
		EACH [Element Category], $(i, item) 
		AND(
			$item = [Element Category]#[LineNumber],
			$i < [LineNumber]
		)
	)
)

LET $data :=
ARRAY_TRANSPOSE(
	ARRAY(
		EACH [Element Category],
		EACH [Element Weighting]
	)
);

LET $number := 
SUM(
	ARRAY_WHERE(
		$data, $(i, item) 
		ARRAY_INDEX($item, 1) = [Element Category]
	)
);

RETURN 
$number

Column.ValidationFormula:
LET $criteria:= 
IF(
	ISBLANK([Category Weighting]), "Element Must have a Description.",
	[Total Element Weighting]<>100, "Selection Criteria must total to 100%.", NULL()
);

LET $duplicateCriteriaElement := 
(
	LET $criteria := 
	ARRAY_WHERE(
		EACH [Element], 
		$(i, item) $item <> NULL()
	); 

	LET $distinct := ARRAY_DISTINCT($criteria); 

	RETURN 
	IF(
		ARRAY_LENGTH($distinct) <> ARRAY_LENGTH($criteria), 
		"Cannot have duplicate criteria elements"
	)
);

LET $duplicateCriteriaCategory := 
(
	LET $criteriaGroups := 
	ARRAY_SELECT(
		ARRAY_WHERE(
			ARRAY_TRANSPOSE(
				ARRAY(
					EACH [New Category],
					EACH [Element Category]
				)
			), $(i, item) ARRAY_INDEX($item, 1) = TRUE
		), $(i, item) 
		ARRAY_INDEX($item, 2)
	); 

	LET $distinct := ARRAY_DISTINCT($criteriaGroups); 

	RETURN 
	IF(
		ARRAY_LENGTH($distinct) <> ARRAY_LENGTH($criteriaGroups), 
		"Cannot have duplicate criteria categories"
	)
);

LET $rules := 
ARRAY(
  $criteria, 
  $duplicateCriteriaElement,
  $duplicateCriteriaCategory
);

LET $result:=
ARRAY_JOIN(
	ARRAY_WHERE($rules, $(i, item) $item <> NULL()), 
	"
"
);

LET $result := IF($result==NULL(), TRUE, $result);

RETURN $result

Column.Formula:
LET $current := ARRAY([EFormType], [RecordID]);
LET $descriptionColumns := 
HASH(
	"Contract",  					"Contract Number", 
	"Vendor", 						"Company Name",
	"Procurement", 					"Procurement Number",
	"Project", 						"Project Number",
    "Evaluation", 		    		"Description",
  	"Information Request",  		"File No.", 
	"Subpoena", 					"File No.",
	"Privacy Incident", 			"File No."
); 

LET $altFormName:= HASH(
  	"Insurance",	"Compliance"
  );

LET $getLabelText := $(eFormType, recordID)
(
  	LET $targetColumn := HASH_GET($descriptionColumns, $eFormType);
  	RETURN 
  	IF( $targetColumn = NULL, NULL,
		LET $isthisRecord := ARRAY($eFormType, $recordID) = $current;
		LET $title:= 
		IF( $isthisRecord = TRUE, 
			CURRENT_VALUE($targetColumn),
			ARRAY_FIRST(DB_LOOKUP(
				ARRAY($targetColumn),
				$eFormType, 
				"[RecordID] FAST_EQUAL_TO " & $recordID
			))
		  );
		//shortern the descriptive label/ title
		LET $charCount := LEN($title);
		LET $titleArray := SPLIT($title, " ");
		LET $wordCount := ARRAY_LENGTH($titleArray);

		LET $charLimit := 30; 
		LET $wordLimit := ARRAY_LENGTH( SPLIT( LEFT($title, $charLimit), " ") );

	  RETURN //ARRAY_TAKE($titleArray, $wordLimit)
		IF(
			$wordCount <= $wordLimit, $title,
			ARRAY_JOIN(
				ARRAY_TAKE($titleArray, $wordLimit), " "
			)& " ..."
		)
	  )

); 

LET $getReadAccess := $(eFormType, recordID)
( EBMS_GET_EFORMRECORD_PERMISSION($eFormType, $recordID, "read"));

LET $currentDes := CALL($getLabelText, [EFormType], [RecordID]);
LET $currentAccess := FALSE;

RETURN
IF(
	[Parent Structure] <> NULL, [Parent Structure],
  	(

	  LET $parent := 
	  IF( 
		[RecordID] > 0, 
		(
		  LET $record := EBMS_GET_PARENT_RECORD(ARRAY_FIRST($current), ARRAY_INDEX($current, 2));
		  RETURN 
			  IF(  ARRAY_FIRST($record) == NULL, NULL,
				ARRAY_CONCAT( 
				  $record, 
				  CALL($getLabelText, ARRAY_FIRST($record), ARRAY_INDEX($record, 2)),
				  CALL($getReadAccess, ARRAY_FIRST($record), ARRAY_INDEX($record, 2))
				  )

			  )
	  )); 

	  LET $gParent := 
	  IF( 
		 $parent <> NULL, 
		(
		  LET $record := EBMS_GET_PARENT_RECORD(ARRAY_FIRST($parent), ARRAY_INDEX($parent, 2));
		  RETURN 
			  IF(  ARRAY_FIRST($record) == NULL, NULL,
				ARRAY_CONCAT( 
				  $record, 
				  CALL($getLabelText, ARRAY_FIRST($record), ARRAY_INDEX($record, 2)),
				  CALL($getReadAccess, ARRAY_FIRST($record), ARRAY_INDEX($record, 2))
			  )
		  )
	  )); 

	  LET $hash :=  
	  HASH_MERGE(
		  IF( $parent <> NULL, HASH("parent", 	$parent)),
		  IF( $gParent <> NULL, HASH("gparent", 	$gParent))
	  );

	  LET $parentStructure := 	//2nd instance
	  IF( 
		  ARRAY_LENGTH(HASH_KEYS($hash)) >0, $hash, NULL
	  );

	  LET $parentData:= 
	  ARRAY_WHERE(
		ARRAY(
			$gParent, 
			$parent, 
			ARRAY_CONCAT($current, $currentDes, $currentAccess),
		), $(i,item) $item <> NULL
	   );


	  LET $parentChain:=
		ARRAY_SELECT(
			  $parentData, $(i, item)
			  ARRAY_TAKE($item, 2)
	   );


	  LET $parentLinks :=
	  ARRAY_SELECT(
		  $parentData, $(i, item) 
			  LET $eFormType 		:= ARRAY_FIRST($item);
			  LET $recordID 		:= ARRAY_INDEX($item, 2);
			  LET $descriptiveLabel := ARRAY_INDEX($item, 3);
			  LET $hasReadAccess	:= ARRAY_INDEX($item, 4);
			  LET $URL	:= "records/" & URLENCODE($eFormType) & "/" & $recordID ;
			  LET $showEFormType := $eFormType <> "Vendor";

			  LET $labelColour := 
				  IF(
				   AND($eFormType = [EFormType], $recordID = [RecordID]),
					  "background: #ffffff; color: #5D5D5D;",
					 $hasReadAccess = TRUE,
					  "background: #ffffff; color: #4D87B7;",
					  "background: #ffffff; color: #5D5D5D;"

				  );



			  LET $labeltext:= 
					  IF( $showEFormType == TRUE, " " & COALESCE(HASH_GET($altFormName, $eFormType), $eFormType) ) &
					  IF(NOT(ISBLANK($descriptiveLabel)), " " & $descriptiveLabel);

			  LET $label :=  
				  "<span style=""margin-left: 5px;" & $labelColour & """>" &
				  HTMLENCODE($labeltext) & 
				  "</span>";

			  RETURN 
			  IF( 
				  $hasReadAccess == TRUE, 
				  "<a style=""text-decoration-line: none;"" href=" & HTMLENCODE($URL) & ">" & $label & "</a>",
				  $label 
			  )
	  );

	   LET $separator :=   "<svg style=""vertical-align: bottom; margin-left: 5px; height: 18px;"" xmlns=""http://www.w3.org/2000/svg"" viewBox=""0 0 256 512""><path fill=""#5D5D5D"" d=""M246.6 278.6c12.5-12.5 12.5-32.8 0-45.3l-128-128c-9.2-9.2-22.9-11.9-34.9-6.9s-19.8 16.6-19.8 29.6l0 256c0 12.9 7.8 24.6 19.8 29.6s25.7 2.2 34.9-6.9l128-128z""/></svg>";

	  LET $breadcrumb := "<div style=""height: 23px; padding-left: 5px; font-size: 10pt; color: #5D5D5D; "">You are here:" & ARRAY_JOIN($parentLinks, $separator) & "</div>";

	  RETURN 
	  HASH(
		  "Parent Structure",	$parentStructure,
		  "Parent Data", 		$parentData,
		  "Parent Chain",		$parentChain,
		  "Breadcrumb",		$breadcrumb
		)
	 )
)

FieldEntry.Formula:
LET $before := ARRAY_TAKE(
	EACH [Element], 
	[LineNumber]
);
LET $after :=
ARRAY_SKIP(
	EACH [Element],
	[LineNumber] 
);

RETURN 
ARRAY_CONCAT(
	$before, 
	"", 
	$after
)

LET $before := ARRAY_TAKE(
	EACH [Element Category], 
	[LineNumber]
);
LET $after :=
ARRAY_SKIP(
	EACH [Element Category],
	[LineNumber] 
);

RETURN 
ARRAY_CONCAT(
	$before, 
	COALESCE([Element Category], ""), 
	$after
)

LET $before := ARRAY_TAKE(
	EACH [Element Number], 
	[LineNumber]
);
LET $after :=
ARRAY_SKIP(
	EACH [Element Number],
	[LineNumber] 
);

RETURN 
ARRAY_CONCAT(
	$before, 
	FALSE, 
	$after
)

LET $before := ARRAY_TAKE(
	EACH [Element Weighting], 
	[LineNumber]
);
LET $after :=
ARRAY_SKIP(
	EACH [Element Weighting],
	[LineNumber] 
);

RETURN 
ARRAY_CONCAT(
	$before, 
	NULL(), 
	$after
)

LET $before := ARRAY_TAKE(
	EACH [New Category], 
	[LineNumber]
);
LET $after :=
ARRAY_SKIP(
	EACH [New Category],
	[LineNumber] 
);

RETURN 
ARRAY_CONCAT(
	$before, 
	FALSE, 
	$after
)

LET $before := ARRAY_TAKE(
	EACH [Criteria Type], 
	[LineNumber]
);
LET $after :=
ARRAY_SKIP(
	EACH [Criteria Type],
	[LineNumber] 
);

RETURN 
ARRAY_CONCAT(
	$before, 
	IF(
	  OR(
		[Criteria Type] = "Gateway", 
		[Element Category] = "Gateway Criteria"
	  ), "Gateway", 
	  OR(
		[Criteria Type] = "Mandatory", 
		[Element Category] = "Mandatory Criteria"
	  ), "Mandatory", 
	  "Discretionary"
	),
	$after
)
